import React from 'react';
import logo from '../assets/logo.png'; // Adjust the path based on your file structure

function Logo() {
  return (
    <div className="logo">
      <img src={logo} alt="Car Care Logo" className="logo-image" />
    </div>
  );
}

export default Logo;
